@danieldibswe @davidsamuelps @kmcnam1 @PeteCCDE What I experienced with @AristaNetworks switches is - those pings were dropped, at max 3 drops with 1sec pooling, and some times no drops either.

Per my understanding there shouldn't be any drops, as there was NO L2 events.

Note: SRC to DST ping is 3 hops away
